import React from 'react';
import logo from './logo.svg';

import { BrowserRouter, Route, Link } from 'react-router-dom';
import Projects from './components/Projects.js';

// Styles
import './css/App.css';
import './css/bootstrap.min.css';
import './css/magnific-popup.css';
import './css/style.css';

function App() {
  return (
    <BrowserRouter>
      <div className="App">

      // Set up the Router
       <Route exact path="/" component={Projects} />
       <Route path="/articles" component={Articles} />
       <Route path="/about" component={About} />

        <header className="header-section">
          <div className="container">
            <div className="row">
              <div className="col-lg-4 col-md-3">
                <div className="logo">
                  <h2 className="site-logo">William Pepera</h2>
                </div>
              </div>
              <div className="col-lg-8 col-md-9">
                <a href="https://www.linkedin.com/in/william-pepera-15978598/" className="site-btn header-btn" target="_blank"></a>
                <nav className="main-menu">
                  <ul>
                    <li><Link to="/" className="item">Projects</Link></li>
                    <li><Link to="/articles" className="item">Articles</Link></li>
                    <li><Link to="/about" className="item">About</Link></li>
                    <li><Link to="/contact" className="item">Contact</Link></li>
                  </ul>
                </nav>
              </div>
            </div>
          </div>
          <div className="nav-switch">
            <i className="fa fa-bars"></i>
          </div>
        </header>
      </div>
    </BrowserRouter>
  );
}

export default App;
